import { TextInput, View } from "react-native"


const  Datahandle=()=>{
    const [data,setData]= useState({
        name:"",
        age:"",
        registration:""
    });
    return(
      <View>
        <TextInput 
        placeholder="Name"
        value={data.name}
        onChangeText={setData()}/>
        <TextInput 
        placeholder="Name"
        value={data.name}
        onChangeText={setData()}/>
        <TextInput 
        placeholder="Name"
        value={data.name}
        onChangeText={setData()}/>
      </View>

    )
}
export default Datahandle;
